import React from 'react';

// Version fonction moderne (recommandée)
const App = () => {
  return (
    <div className="app">
      <h1>Prédiction du prix de voiture</h1>

      <form>
        <div className="form-group">
          <label>Kilométrage</label>
          <input type="number" placeholder="Ex: 50000" />
        </div>

        <div className="form-group">
          <label>Année</label>
          <input type="number" placeholder="Ex: 2018" />
        </div>

        <button type="submit" className="predict-btn">Prédire</button>
      </form>
    </div>
  );
}

export default App; // Ligne ESSENTIELLE
